class ProjectBranchResponseModel {  List<ProjectBranchModel>? data;  ProjectBranchResponseModel({this.data});  ProjectBranchResponseModel.fromJson(List<dynamic>? json) {    if (json != null) {      data = <ProjectBranchModel>[];      json.forEach((v) {        data!.add(new ProjectBranchModel.fromJson(v));      });    }  }  Map<String, dynamic> toJson() {    final Map<String, dynamic> data = new Map<String, dynamic>();    if (this.data != null) {      data['Data'] = this.data!.map((v) => v.toJson()).toList();    }    return data;  }}class ProjectBranchModel {  int? branchId;  String? branchName;  String? slug;  String? address;  String? phone;  String? email;  bool? isSelected;  ProjectBranchModel(      {this.branchId,        this.branchName,        this.slug,        this.address,        this.phone,        this.email, this.isSelected = false});  ProjectBranchModel.fromJson(Map<String, dynamic> json) {    branchId = json['branch_id'];    branchName = json['branch_name'];    slug = json['slug'];    address = json['address'];    phone = json['phone'];    email = json['email'];    isSelected = false;  }  Map<String, dynamic> toJson() {    final Map<String, dynamic> data = new Map<String, dynamic>();    data['branch_id'] = this.branchId;    data['branch_name'] = this.branchName;    data['slug'] = this.slug;    data['address'] = this.address;    data['phone'] = this.phone;    data['email'] = this.email;    return data;  }}